import React, { useState } from "react";
import "./App.css";

function App() {
  const [appStarted, startApp] = useState(false);
  return (
    <div className="App">
      {appStarted ? (
        <div />
      ) : (
        <button onClick={() => startApp(true)}>EXPLORE</button>
      )}
    </div>
  );
}

export default App;
